if mibBuilder.loadTexts: intSrvGuaranteedIfBacklog.setDescription('The Backlog parameter is the data backlog resulting from the vagaries of how a specific implementation deviates from a strict bit-by- bit service. So, for instance, for packetized weighted fair queueing, Backlog is set to the Maximum Packet Size. The Backlog term is measured in units of bytes. An individual element can advertise a Backlog value between 1 and 2**28 (a little over 250 megabytes) and the total added over all ele- ments can range as high as (2**32)-1. Should the sum of the different elements delay exceed (2**32)-1, the end-to-end error term should be (2**32)-1.')
